import React from 'react';

import MenuItem from '../menu-item/menu-item.component';

import './directory.styles.scss';

class Directory extends React.Component {
	constructor() {
		super();

		this.state = {
			sections: [{
				title: 'Mens',
				imageUrl: 'https://images.unsplash.com/photo-1528329140527-75853b1e1650?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1575&q=80',
				id: 1,
				size: 'large',
			}]
		}
	}

	render() {
		return(
		 <div className='directory-menu'>
		  {
		  	this.state.sections.map(({title, imageUrl, size}) => (
		  		<MenuItem title={title} imageUrl={imageUrl} size={size}/>
		  		))
		  }
		 </div>

	  )
	}
}

export default Directory;
